@wp.kernel
def loop_qloxuo(arr: wp.array(dtype=float), out: wp.array(dtype=float)):
    tid = wp.tid()
    acc = float(0.0)
    for i in range(2):
        acc = acc + arr[tid] * float(i + 1)
    out[tid] = acc

